CAST
Alexis Texas, Danny Mountain, James Deen, Jenna Haze, Johnny Sins, Madelyn Marie, Marie Luv, Scott Nails, Stoya, Tobi Pacific, Tommy Gunn

DESCRIPTION
STOYA: ATOMIC TEASE is an homage to the burlesque style shorts of the Betty Page era. Conceived by celebrated director, Celeste, the Atomic Tease series is a tempting ride of sexual tease and playful stimulation. Stoya`s seductiveness excites Jenna Haze and Danny Mountain in a smoldering threesome. Stoya then double teams James Deen with the help of Marie Luv. Tired of sharing c*ck, Stoya takes Scott Nails on by herself. Don`t miss out!
